INSERT INTO `v1_268a44bc268433e27dd8ca81f6da2e5b11f36d247acd56b4db9d48645ff0d157` VALUES (1, 513043, 0, 0, 5, "ふふ。ボクを呼んでくれて正解だよ。\nこの新年の晴れやかな日にこそ\nボクの輝く美貌が必要だからね！", 0.5, 0, 11, 100811, 513);
