INSERT INTO `v1_268a44bc268433e27dd8ca81f6da2e5b11f36d247acd56b4db9d48645ff0d157` VALUES (1, 513048, 0, 0, 5, "クウカはこんな新年早々に\n豪華な料理とたくさんの人の前で\nドSさんに弄ばれ辱めを……！\nぐふふ……ぐふふふふ。", 0.5, 0, 11, 104511, 513);
